import React, { Component } from 'react'
import axios from 'axios'
import data from '../../../public/json/data'

class CitiesPage extends Component {
    componentDidMount(){
        axios.get('data')
        .then(res => {
            console.log(res)
        })
    }
    render() {
        return (
            <div className="container" >
                <h2 className="cities-list">
                    Cities List
            </h2>
            </div>
        )
    }
}

export default CitiesPage;
